import React from 'react'
import { Link } from 'react-router-dom';
import CardComponent from '../../components/Card/CardComponent';
import { POWERFUL_TOOLS_CONTENT, SECURITY_AND_IT_HEADER_CONTENT, SECURITY_AND_IT_SUB_CONTENT } from '../../utils/cms';
import { cardContainerData } from '../LandingPage/data';

function Tools() {
  return (
    <div className={styles.contentSection}>
    <div className={styles.powerfulToolsHeader}>
      {POWERFUL_TOOLS_CONTENT}
    </div>
    <div className={styles.titleContent}>
      {SECURITY_AND_IT_HEADER_CONTENT}{" "}
    </div>
    <div className={styles.titleSubContent}>
      {SECURITY_AND_IT_SUB_CONTENT}
    </div>

    <div className={styles.cardContentSection}>
      {cardContainerData.map((ele, i) => {
        return (
          <CardComponent
            image={ele.image}
            heading={ele.heading}
            subHeading={ele.subHeading}
          />
        );
      })}
    </div>
    <div className={styles.button}>
      <Link
        className={styles.buttonContentSection}
        to="/getStarted"
      >
        GET STARTED
      </Link>
    </div>
  </div>
  )
}

export default Tools
